import { Box, makeStyles } from '@material-ui/core'
import React from 'react'

const useStyles = makeStyles((theme) => ({
    sideNav: {
        position:'absolute',
        height: '100vh',
        width: '300px',
        backgroundColor: '#f4f5fd',
        right: '0'
      }

 }))

function Profile() {
    const classes = useStyles()
    return (
        <Box className={classes.sideNav}>

        </Box>
    )
}

export default Profile
